script: |
  super -f text -I q11150.spq | sort > q11150.out

inputs:
  - name: q11150.spq
    data: |
      SELECT - ( + - ( + col1 ) ) FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col0 IN ( - + col2, col0, ( + col1 ) / + col1 * - 92 + - 31 );
  - name: tab2

outputs:
  - name: q11150.out
    data: |
      51
      67
      77
